import React from 'react';
import '../style.css'
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    Redirect,
  } from "react-router-dom";
  import AdoptionPanel from './AdoptionPanel'
  import AdoptionItem from './AdoptionItem'
  import placeHolder from './images/dog.jpg'



class AdoptionScreen extends React.Component {

    render() {

        const prod1 = [<AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,]
        const prod2 = [<AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,]

        return (
            <div id="displayPanelHolder">
                <h2>Nossos animais estão buscando um lar!</h2>
                <div id="filtros">
                    <p>Filtrar:</p>
                    <input type="checkbox" id="gatos" name="Gatos" checked />
                    <label>Gatos</label>
                    <input type="checkbox" id="cachorros" name="Cachorros" checked />
                    <label>Cachorros</label>
                    <input type="checkbox" id="adocao" name="Adocao" checked />
                    <label>Adoção</label>
                    <input type="checkbox" id="venda" name="Venda" checked />
                    <label>Venda</label>
                </div>
                <AdoptionPanel/>
            </div>
        );
    }
}

export default AdoptionScreen;
